INSERT INTO `tbl_tulisan` (`tulisan_id`, `tulisan_judul`, `tulisan_isi`, `tulisan_tanggal`, `tulisan_kategori_id`, `tulisan_kategori_nama`, `tulisan_views`, `tulisan_gambar`, `tulisan_pengguna_id`, `tulisan_author`, `tulisan_img_slider`, `tulisan_slug`) VALUES
	(20, 'NTB Mall, Lades & SIMPUL Hadir Sebagai Solusi Digitalisasi UMKM di Tengah Pandemi Covid', '<p>Kondisi UMKM Sebelum COVID dialami cukup baik oleh hampir seluruh pelaku usaha. Namun,saat terjadi COVID keadaan berbalik.&nbsp;56,8% UMKM berada dalam kondisi buruk, hanya 14,1% UMKM yang masih berada kondisi baik</p>\r\n\r\n<p>Mayoritas UMKM atau sebanyak&nbsp;82,9% mengalami dampak negatif&nbsp;dari pandemi ini. Hanya sebagian kecil atau 5,9% dari pelaku yang justru mengalami dampak positif.&nbsp;</p>\r\n\r\n<p>Pandemi ini bahkan menyebabkan 63,9% dari UMKM yang terdampak mengalami&nbsp;penurunan omzet lebih dari 30%.&nbsp;Hanya 3,8% UMKM yang mengalami peningkatan omzet.</p>\r\n', '2017-05-17 17:24:42', 5, 'Penelitian', 27, 'b896ff24baad8d12854ce0b3b5c9cfdb.jpg', 1, 'M Fikri Setiadi', 0, 'ntb-mall,-lades-&-simpul-hadir-sebagai-solusi-digitalisasi-umkm-di-tengah-pandemi-covid'),
	(22, 'Dinas Perdagangan: Mayoritas UMKM Terpukul Corona, Penjualan Anjlok Lebih dari 50%  ', '<p>Dinas Perdagangan&nbsp;mencatat sebanyak 72,6% usaha mikro kecil dan menengah terdampak pandemi corona. Para pengusaha tersebut mengalami penurunan penjualan, hingga kesulitan modal dan bahan baku.&nbsp; Kepala Departemen Pengembangan UMKM dan Perlindungan Konsumen Bank Indonesia Budi Hanoto&nbsp;mengatakan, Covid-19 mendisrupsi kinerja UMKM. Berdasarkan sektornya, UMKM pertanian yang terpukul mencapai 41,5%, UMKM eksportir mencapai 95,4%, dan UMKM kerajinan dan pendukung pariwisata mencapai 89,9%.&nbsp; &ldquo;Rata-rata penurunan omzet mereka mencapai lebih dari 50%,&rdquo; kata Budi dalam webinar UMKM Gearing-Up Into New Normal bertajuk Solusi Pembiayaan, Pemasaran dan Digitalisasi, Kamis (25/6). Padahal, UMKM memiliki peran strategis dalam menopang perekonomian nasional. BI bahkan mencatat produk domestik bruto riil yang dihasilkan sektor UMKM pada 2018 mencapai Rp 694reiliun atau tumbuh 7,3% dibanding tahun sebelumnya. Total 64,2 juta unit usaha UMKM yang ada saat ini juga dapat menyerap 116,98 juta tenaga kerja. &ldquo;UMKM ini konsisiten berkontribusi 60% terhadap PDB. 10% saja produktivitasnya ditingkatkan dapat meningkatkan pertumbuhan ekonomi,&rdquo; jelasnya. (Baca: BI Bersedia Berbagi Beban dengan Pemerintah untuk Pulihkan Ekonomi) Untuk mengatasi kondisi saat ini, UMKM perlu meningkatkan kemampuan terutama dalam digitalisasi. Pemasaran perlu didorong melalui e-commerce,&nbsp;ssedangkan kebutuhan pembiyaan dapat menggunakan instrumen peer to peer lending.&nbsp; Sementara itu, Menteri Koperasi dan UMKM Teten Masduki mengatakan, kondisi krisis saat ini jauh berbeda dengan saat 1998. Saat krisis yangg terjadi dua dekade lalu itu, UMKM mampu menjadi penyelamat perekonomian nasional dengan kenaikan ekspor mencapao 345%. &quot;Sementara kini, UMKM justru ikut terpukul, baik dari sisi permintaan maupun suplai.&nbsp; Ia bahkan memperkirakan separuh UMKM bakal tumbang tanpa ada penanganan khusus dari pemerintah. Adapun saat ini, memiliki startegi yang dibagi dalam tiga point utama untuk menyelamatkan UMKM. Pertama, Pemerintah memberikan relaksasi kredit kepada UMKM dengan penundaan cicilan hingga 6 bulan, lalu penghapusan pajak, dan juga pemberian modal tambahan. &ldquo;Selain itu kami juga mendorong UMKM masuk program Jaminan Sosial,&rdquo; kata dia. Untuk mendorong permintaan, pemerintah juga terus mendorong dan berkampanye agar masyarakat menggunakan produk UMKM. Belanja pemerintah dan BUMN juga didorong untuk menggunakan produk UMKM.&nbsp; (Baca: Pergub Pelarangan Kantong Plastik Memberatkan UMKM) Sementara itu, PT Espay Debit sebagai operator DANA menyatakan komitmennya&nbsp; untuk membantu dan mendorong UMKM beralih ke ranah digital. CEO &amp;&nbsp;Co-Founder&nbsp;DANA Vincent Iswara mengatakan, keberadaan DANA secara tidak langsung mendorong masyarakat maupun pelaku usaha untuk mendukung keberadaan QRIS. Fitur yang dimiliki mereka memungkinkan pedagang menerima pembayaran dari&nbsp;e-money&nbsp;ataupun&nbsp;e-wallet. Pencairan dana pun dapat dilakukan di hari&nbsp; yang sama.&nbsp; Adapun sejak pandemi Covid-19, banyak pedagang marak beralih ke digitalisasi, termasuk pemasaran dan&nbsp; transaksinya. Piaknya bagkan mencatat terdapau 180 ribu pedagang baru yang bekerja sama dengan pihaknya. Sementara rata-rata transaksi setiap hari saat ini mencapai 3 juta.&nbsp; &ldquo;Melalui fasilitas DANA, kami berharap UMKM dapat bertahan pada situasi yang sulit saat ini,&quot; kata dia.&nbsp;<br />\r\n<br />\r\nArtikel ini telah tayang di&nbsp;<a href="https://katadata.co.id/" target="_blank">Katadata.co.id</a>&nbsp;dengan judul &quot;BI: Mayoritas UMKM Terpukul Corona, Penjualan Anjlok Lebih dari 50%&quot; ,&nbsp;<a href="https://katadata.co.id/agustiyanti/berita/5ef572d27c7b2/bi-mayoritas-umkm-terpukul-corona-penjualan-anjlok-lebih-dari-50">https://katadata.co.id/agustiyanti/berita/5ef572d27c7b2/bi-mayoritas-umkm-terpukul-corona-penjualan-anjlok-lebih-dari-50</a><br />\r\nPenulis: Muchammad Egi Fadliansyah<br />\r\nEditor: Agustiyanti</p>\r\n', '2017-05-17 17:38:21', 5, 'Penelitian', 1, 'c3d5062e730ed569dccbde430f6407ec.jpg', 1, 'KataData', 0, 'dinas-perdagangan:-mayoritas-umkm-terpukul-corona,-penjualan-anjlok-lebih-dari-50%'),
	(23, 'Ekspor Produk UMKM Baru 14%, Menteri Koperasi Kaji Gaet E-Commerce ', '<p>Menteri Koperasi dan Usaha Kecil Menengah (UKM) Teten Masduki mencatat, sekitar 14% produk UMKM sudah diekspor. Untuk mengetahui selera pasar baik di dalam maupun luar negeri, ia pun mengkaji peluang kerja sama dengan e-commerce seperti Tokopedia, Bukalapak, dan lainnya. Teten mencatat, ada sekitar 62 juta UMKM di Indonesia dan menyerap 97% tenaga kerja. Karena itu, menurutnya UMKM bisa menjadi katalisator perekonomian. &ldquo;Seharusnya UMKM mendapat perhatian,&rdquo; katanya di Jakarta, Kamis (7/11). Untuk itu, ia ingin memperluas pasar UMKM. Salah satu caranya dengan mendigitalkan operasional UMKM lewat e-commerce ataupun teknologi finansial (fintech) pembayaran. Ia yakin hal ini bisa meningkatkan daya saing UMKM. (Baca: Bertemu Menteri Koperasi, Bos Tokopedia Ungkap Peluang UMKM Ekspor) Terkait ekspor, ia menilai kualitas produk perlu menjadi perhatian. &ldquo;Harus ada quality processing supaya mereka bisa meningkatkan produksi (dengan teknologi). Nanti kami coba dalam bentuk baru,&rdquo; kata dia. &nbsp; Sejalan dengan hal itu, ia melihat potensi UMKM masuk ke platform e-commerce sangat besar. &ldquo;Yang paling penting, harus punya market intelligence,&rdquo; katanya. Melalui aplikasi, ia berharap UMKM mendapat insight atau kesimpulan dari data-data terkait pasar. Dengan begitu, UMKM bisa memahami selera pasar, sehinga memproduksi barang sesuai permintaan konsumen. &ldquo;Kalau tidak aplikasi ini (e-commerce) akan dikuasai oleh barang-barang impor, karena tadi mereka punya market intelligence,&rdquo; kata dia. (Baca: Bukalapak dan Pemerintah Kerja Sama Gaet UKM Berbasis Pesantren) Sejauh ini, Kementerian Koperasi dan UKM mengajak diskusi Tokopedia dan Bukalapak. Pendiri sekaligus CEO Tokopedia William Tanuwijaya sempat menyampaikan, pertemuan itu membahas tentang cara untuk meningkatkan pendapatan UMKM hingga peluang ekspor. Selain membuka pasar, UMKM harus berfokus pada kualitas produk dan konsisten. &ldquo;Kalau sudah diekspor, tetapi dari sisi kualitas tidak bisa bersaing, ya bagaimana mungkin,&rdquo; kata&nbsp;William beberapa waktu lalu (4/11).&nbsp;Karena itu dia membuat konsep&nbsp;agar UMKM punya daya saing terlebih dulu. Tak hanya itu, UMKM juga harus mampu memproduksi dalam skala besar jika ingin ekspor. Karena itu, butuh program pelatihan khusus bagi UMKM. Bukan hanya terkait produksi barang, tetapi manajemen kemampuan juga perlu ditingkatkan. Berdasarkan catatannya, UMKM yang berpeluang mengekspor produk adalah yang bergerak di bidang fesyen dan kosmetik. &ldquo;Saya belum punya datanya, tetapi potensi ekspornya masih besar sekali,&rdquo; kata dia. (Baca: Riset: 89% UKM RI Kembangkan Bisnis Pakai Facebook hingga Instagram) Beberapa e-commerce juga sudah mengekspor produk lokal Indonesia. Bukalapak misalnya, merambah pasar ekspor dengan meluncurkan BukaGlobal pada pertengahan Mei lalu. Lewat layanan ini, pengguna di Malaysia, Singapura, Brunei Darussalam,&nbsp;Hong Kong, dan Taiwan bisa membeli produk Indonesia melalui Bukalapak. &ldquo;Makanan khas (Indonesia) diekspor ke lima negara,&rdquo; kata Presiden Bukalapak Fajrin Rasyid, beberapa waktu lalu (16/7). Makanan khas tersebut meliputi kopi hingga kudapan lokal. Selain itu, Bukalapak telah mengekspor batik dan pakaian tradisional lainnya, serta kerajinan tangan ke lima negara. Saat ini, Bukalapak telah menggaet lebih dari empat juta UMKM untuk berjualan online. Unicorn ini juga memiliki lebih dari dua juta pedagang offline yang disebut mitra Bukalapak. Mitra berupa warung dan wirausaha mandiri ini sudah hadir di 477 dari 514 kota dan kabupaten di Indonesia. (Baca: Bukalapak hingga Tokopedia Mulai Incar Pasar Ekspor) Shopee juga menargetkan bisa mengekspor 5 ribu produk Usaha Mikro, Kecil dan Menengah (UMKM) Indonesia ke Malaysia dan Singapura pada akhir tahun ini. Untuk mewujudkan rencana tersebut, Shopee bakal memaksimalkan gudang (warehouse) di luar negeri. Hanya, Head of Government Relationship Shopee Indonesia Radityo Triatmojo tidak menjelaskan secara rinci jumlah gudang yang dimiliki di kedua negara tersebut. &ldquo;Secara logistik, kami akan optimalisasi lokal warehouse di luar negeri,&rdquo; kata dia, beberapa waktu lalu (12/7). Ia memperkirakan, pemanfaatan gudang ini akan menurunkan biaya logistik hingga 50%. Dengan begitu, ia berharap harga produk Indonesia kompetitif dibanding buatan negara lain. Selain itu, perusahaan e-commerce asal Singapura ini bekerja sama dengan 17 kementerian dan lembaga (K/L), termasuk Bank Indonesia (BI) yang membina sekitar 40 ribu UMKM. PT Global Digital Niaga atau Blibli.com juga berencana mengekspor produk lokal ke beberapa negara di Asia. Saat ini, Blibli.com sudah menggaet 100 ribu mitra penjual per Kuartal I 2019.<br />\r\n<br />\r\nArtikel ini telah tayang di&nbsp;<a href="https://katadata.co.id/" target="_blank">Katadata.co.id</a>&nbsp;dengan judul &quot;Ekspor Produk UMKM Baru 14%, Menteri Koperasi Kaji Gaet E-Commerce&quot; ,&nbsp;<a href="https://katadata.co.id/desysetyowati/digital/5e9a4e5501d60/ekspor-produk-umkm-baru-14-menteri-koperasi-kaji-gaet-e-commerce">https://katadata.co.id/desysetyowati/digital/5e9a4e5501d60/ekspor-produk-umkm-baru-14-menteri-koperasi-kaji-gaet-e-commerce</a><br />\r\nPenulis: Desy Setyowati,Tri Kurnia Yunianto<br />\r\nEditor: Desy Setyowati</p>\r\n', '2017-05-17 17:41:30', 5, 'Penelitian', 3, 'b0f5082b06ce6e5dbfa947e9a009f3cc.jpg', 1, 'KataData', 0, 'ekspor-produk-umkm-baru-14%,-menteri-koperasi-kaji-gaet-e-commerce'),
	(24, 'Digitalisasi, Strategi UMKM Selamat dari Krisis ', '<p>Krisis ekonomi akibat pandemi Covid-19 telah berdampak terhadap kelangsungan usaha mikro, kecil, dan menengah (UMKM). Data Kementerian Koperasi dan UKM menyebutkan, sekurangnya ada 37 ribu pelaku UMKM yang terpukul selama pandemi. Padahal UMKM merupakan penggerak utama perekonomian Indonesia. Pada 2018, sektor ini berkontribusi 60,34% terhadap produk domestik bruto (PDB). Tak hanya itu, ada 116 juta orang atau 97,02% dari total pekerja di tanah air terserap di sektor UMKM. Terpukul Pandemi Covid-19 Foto: ANTARA FOTO/Fikri Yusuf/hp. Pandemi menerbitkan kecemasan para pelaku UMKM. Turunnya daya beli menyebabkan omzet mereka turun. Fenomena ini tergambar dalam survei Katadata Insight Center (KIC) terhadap pelaku UMKM di Jabodetabek pada medio Juni lalu. Hasil survei menunjukkan hanya 5,9% UMKM yang mampu memetik untung ditengah pandemi. Namun di sisi lain, ada 82,9% pelaku usaha yang terkena dampak negatif pandemi. Bahkan 63,9% mengalami penurunan omzet lebih dari 30%.<br />\r\n<br />\r\nArtikel ini telah tayang di&nbsp;<a href="https://katadata.co.id/" target="_blank">Katadata.co.id</a>&nbsp;dengan judul &quot;Digitalisasi, Strategi UMKM Selamat dari Krisis - Analisis Data Katadata&quot; ,&nbsp;<a href="https://katadata.co.id/katadatainsightscenter/analisisdata/5f03cf11e0198/digitalisasi-strategi-umkm-selamat-dari-krisis">https://katadata.co.id/katadatainsightscenter/analisisdata/5f03cf11e0198/digitalisasi-strategi-umkm-selamat-dari-krisis</a><br />\r\nPenulis: Katadata Insight Center</p>\r\n', '2017-05-17 17:46:29', 5, 'Penelitian', 163, 'b75b7f8368fd40342d678621f2ee52ed.jpg', 1, 'KataData', 0, 'digitalisasi,-strategi-umkm-selamat-dari-krisis'),
	(25, 'Pengertian UMKM, Kriteria Kekayaan, dan Pemberdayaan di Tengah Pandemi', '<p>UMKM selalu punya peran dalam gerak ekonomi masyarakat. Bahkan, usaha mikro, kecil, dan menengah ini menjadi pendorong bangkitnya perekonomian setelah goncangan melanda Indonesia, seperti krisis moneter 1998 dan krisis keuangan pada 2008. Kondisi tersebut tak berlaku saat ini ketika virus corona menciptakan krisis kesehatan yang memicu resesi ekonomi. Lalu, apa pengertian UMKM yang sering kita dengar dan apa saja kriterianya? Juga bagaimana kondisi sekarang ketika aktivitas ekonomi begitu sempit seiring pembatasan sosial berskala besar di sejumlah daerah untuk menekan penyebaran Covid-19? Pemerintah memberi rambu-rambu kelompok usaha ini melalui Undang-Undang Nomor 20 Tahun 2008 Tentang Usaha Mikro, Kecil, dan Menengah. Pasal 1 aturan tersebut mendefinisikan tiga jenis usaha tersebut sebagai berikut: Usaha mikro yakni usaha produktif milik orang perorangan dan atau badan usaha perorangan. Ada sejumlah kriteri terkait nilai kekayaan usaha dan hasil penjualan atau omzet. Sementara usaha kecil dimaknai sebagai usaha ekonomi produktif yang berdiri sendiri, yang dilakukan oleh orang perorangan atau badan usaha yang bukan merupakan anak perusahaan. Juga bukan pula cabang perusahaan yang dimiliki, dikuasai, atau menjadi bagian dari usaha menengah atau usaha besar secara langsung maupun tidak. (Baca: Penjualan Produk UMKM di Blibli Naik 6 Kali Lipat Imbas Pandemi Corona) Adapun usaha menengah merupakan usaha ekonomi produktif yang berdiri sendiri, yang dilakukan oleh orang perorangan atau badan usaha yang bukan merupakan anak perusahaan. Demikian pula bukan cabang perusahaan yang dimiliki, dikuasai, atau bagian usaha besar secara langsung maupun tidak. Seorang perajin sedang beraktivitas. Saat ini ada skema&nbsp;perlindungan UMKM&nbsp;saat pendemi. (ANTARA FOTO/Indrianto Eko Suwarso/aww.) &nbsp; Karena itu, di pasal ini disebutkan juga usaha besar sebagai usaha ekonomi produktif yang dilakukan oleh badan usaha dengan jumlah kekayaan bersih atau hasil penjualan tahunan lebih besar dari usaha menengah. Jenis ini meliputi usaha nasional milik negara atau swasta, usaha patungan, dan usaha asing yang melakukan kegiatan ekonomi di Indonesia. Kriteria UMKM dari Sisi Kekayaan dan Omzet Dari sisi kekayaan dan omzet atau hasil penjualan, kriteria UMKM tercantum dalam Pasal 6. Usaha mikro yakni ketika kekayaan bersihnya paling banyak Rp 50 juta, tidak termasuk tanah dan bangunan tempat usaha. Sementara hasil penjualan tahunan paling banyak Rp 300 juta. Untuk usaha kecil, batasan kekayaan bersihnya lebih dari Rp 50 juta sampai dengan paling banyak Rp 500 juta, juga tidak termasuk tanah dan bangunan tempat usaha. Dari sisi hasil penjualan tahunan lebih dari Rp 300 juta sampai dengan paling banyak Rp 2,5 miliar. Terakhir, kriteria usaha menengah yakni ketika kekayaan bersihnya lebih dari Rp 500 juta &nbsp;sampai dengan Rp 10 miliar di luar tanah dan bangunan tempat usaha. Adapun hasil penjualan tahunan lebih dari Rp 2,5 miliar sampai paling banyak Rp 50 miliar. Namun aturan ini juga menyebutkan bahwa kriteria dengan nilai nominal tersebut dapat diubah melalui Peraturan Presiden sesuai perkembangan perekonomian. Dengan klasifikasi tersebut, pemerintah berharap UMKM dapat berperan dalam membangun perekonomian nasional, termasuk pengembangan usaha berbasis potensi daerah dan berorientasi pasar. Pada ujungnya akan tercipta struktur perekonomian yang seimbang, termasuk melahirkan lapangan kerja, pemerataan pendapatan, pertumbuhan ekonomi, dan mengatasi kemiskinan. Dan benar, tak heran setiap tahun jumlah UMKM makin besar. Pada 2010, jumlah UMKM yang tersebar di Tanah Air mencapai 52,8 juta usaha. Lima tahun kemudian naik menjadi 59,3 juta. Dan pada 2018 total jumlah UMKM sebanyak 64,2 juta usaha. Perhatikan grafik pada Databoks di bawah ini:<br />\r\n<br />\r\nArtikel ini telah tayang di&nbsp;<a href="https://katadata.co.id/" target="_blank">Katadata.co.id</a>&nbsp;dengan judul &quot;Pengertian UMKM, Kriteria Kekayaan, dan Pemberdayaan di Tengah Pandemi&quot; ,&nbsp;<a href="https://katadata.co.id/muchamadnafi/berita/5ebe19afb009d/pengertian-umkm-kriteria-kekayaan-dan-pemberdayaan-di-tengah-pandemi">https://katadata.co.id/muchamadnafi/berita/5ebe19afb009d/pengertian-umkm-kriteria-kekayaan-dan-pemberdayaan-di-tengah-pandemi</a><br />\r\nPenulis: Muchamad Nafi<br />\r\nEditor: Muchamad Nafi</p>\r\n', '2018-08-08 21:26:08', 5, 'Penelitian', 27, 'd0719285121fcf795cd72de3f57e1c38.jpg', 1, 'KataData', 0, 'pengertian-umkm,-kriteria-kekayaan,-dan-pemberdayaan-di-tengah-pandemi'),
